import React, { Component } from "react";

class AddProcess extends Component {
  state = {
    process: {
      Process_name: "",
      Process_Description: "",
      NumSerie: ""
    }
  };
  handleSubmit = e => {
    e.preventDefault();
    console.log("login enviado");
    window.location.href = "/processes";
  };

  handleChange = e => {
    const process = { ...this.state.process };
    process.Process_name = e.currentTarget.value;
    this.setState({ process });
  };

  /* handleAdd = async () => {
    console.log("Add Process");
    const obj = {
      Process_name: "Proceso agragado",
      Process_Description: "Descripcioin ",
      NumSerie: ""
    };
    const { data: post } = await axios.post(apiEndpoint, obj);
    const Process_name = [post, ...this.state.Process_name];
    this.setState({ Process_name });
  }; */

  render() {
    return (
      <div className="jumbotron m-4">
        <h1>Add Process</h1>
        <form onSubmit={this.handleSubmit}>
          <div className="form-group">
            <label htmlFor="processName">Process Name</label>
            <input
              value={this.state.process.Process_name}
              onChange={this.handleChange}
              autoFocus
              id="processName"
              type="text"
              className="form-control"
            />
          </div>
          <div className="form-group">
            <label htmlFor="processDescription">Process Description</label>
            <input
              id="processDescription"
              type="text"
              className="form-control"
            />
          </div>
          <div className="form-group">
            <label htmlFor="serialNumber">Serial Number</label>
            <input id="serialNumber" type="text" className="form-control" />
          </div>
          <button className="btn btn-primary">Add</button>
        </form>
      </div>
    );
  }
}

export default AddProcess;
